import React, { Component,useState,useEffect } from 'react';
import NavScrollExample from './nav';
import BasicExample from './participate';
import axios from 'axios';
import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import {Link,Outlet} from 'react-router-dom'

const bull = (
    <Box
      component="span"
      sx={{ display: 'inline-block', mx: '2px', transform: 'scale(0.8)' }}
    >
      â€¢
    </Box>
  );
function Home () {
    const[events,setEvents] = useState([]);
    useEffect(()=>
    {
        axios.get('http://localhost:8080/')
        .then(response=>{
            setEvents(response.data);
        })
        .catch(error=>{
            console.log(error);
        });
    },[]);
        return(
            <div>
            <NavScrollExample></NavScrollExample>
            <div className='header'><h3>Events!</h3></div>
            <div  className='all-events'>{events.map(ev=>(
               <Card className='single' sx={{ minWidth: 275 }}>
               <CardContent>
                 <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
                   {ev.category}
                 </Typography>
                 <Typography variant="h5" component="div">
                   {ev.title}
                 </Typography>
                 <Typography sx={{ mb: 1.5 }} color="text.secondary">
                   {ev.type}
                 </Typography>
                 <Typography variant="body2">
                   {ev.organizer}
                   <br />
                   {"start date:"}{ev.startdate}
                   <br />
                   {"end date:"}{ev.enddate}
                   <br />
                   {"start time:"}{ev.starttime}
                   <br />
                   {"endtime time:"}{ev.endtime}
                   <br />
                   {"endtime time:"}{ev.createid}
                 </Typography>
               </CardContent>
               <CardActions>
                    <Link to='/participate'><Button size="small">Register</Button></Link>
                </CardActions>
 
             </Card>
            ))}</div>
            </div>
        );
    }


export default Home;
